<?phpnamespace KooijmanInc\Suzie\Object\FormObject;use KooijmanInc\Suzie\FormBuilder\FormParts\Input\InputInterface;use KooijmanInc\Suzie\SuzieInterface;use Traversable;class ObjectStorage implements ObjectInterface{    protected ?SuzieInterface $suzie;    /**     * @var array     */    protected array $array = [];    public function __construct(SuzieInterface $suzie = null)    {        $this->suzie = $suzie;    }    public function attach(InputInterface &$object, string $name = null): bool    {//dump($object, $this->array);        return ($this->array[$name] = $object) ? true : false;    }    public function getIterator(): Traversable    {        return new \ArrayIterator($this->array);    }}